var qns = [{"title":"I would not normally discover this movie on my own."},
            {"title":"This movie is different (e.g., in style, genre, topic) from the movies I usually watch."},
            {"title":"This movie is a pleasant surprise to me."},
            {"title":"I did not expect that I could find this interesting movie."}
]

export default qns;
